import React from "react";
import IconArrowDown from "./../Icons/IconArrowDown";
import "./ShowDetailsButton.scss";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faHome } from "@fortawesome/free-solid-svg-icons";
import {faPhone} from "@fortawesome/fontawesome-svg-core"

const ShowDetailsButton = ({ onClick }) => (
  <button onClick={onClick} className="show-details-button">
    <span>
      <FontAwesomeIcon style={{ marginLeft: "100px" }} icon={faHome} />


      <IconArrowDown />
    </span>
  </button>
);

export default ShowDetailsButton;
